import moment from "moment";
import dayjs from "dayjs";

// export const today = moment().format("YYYY-MM-DD");

export const today = dayjs().format("YYYY-MM-DD")
export const tomorrow = moment(new Date()).add( 1, 'days').format('YYYY-MM-DD');
